import React, {userState} from 'react';

function TodoForm() {
    const [input,setInput] = useState('');
    
    
    
    return (
        <form className='todo-form'>
            <input
            onChange= {setInput}
            type='text'
            placeholder='Add a todo'
            value={input}
            name='text'
            className='todo-input'>
            </input>
            <button className='todo-button'> Add </button>

        </form>
    );
}

export default TodoForm;
